import React from "react";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faHome , faBaby , faCheckCircle, faFileAlt , faPlusSquare, faUserMd, faCalendar, faCalendarAlt, faAd } from '@fortawesome/free-solid-svg-icons';
import Logo from "../logo1.jpg";
import { Link  } from "react-router-dom";
import Nav from 'react-bootstrap/Nav'

const Navbar = () => {
    return (
<nav className="my-navbar navbar navbar-expand-lg navbar-light  position-fixed w-100">
  <div className="container-fluid">

    <img src={Logo} alt="" width="50" height="50"/>
    {/* <Link to="/" className="navbar-brand">Pregnancy Tracker</Link> */}
    <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
      <span className="navbar-toggler-icon"></span>
    </button>


    <div className="collapse navbar-collapse" id="navbarSupportedContent">
      {/* <ul className="navbar-nav mx-auto mb-2 mb-lg-0"> */}
      {/* <Nav variant="pills" defaultActiveKey="/home"> */}
        {/* <li className="nav-item"> */}
        <Nav.Item>
            <Nav.Link to="/" className="nav-link active">
            <FontAwesomeIcon icon = {faHome}/> &nbsp;  
              Home
            </Nav.Link>
            </Nav.Item>
        {/* </li> &nbsp;   &nbsp;   &nbsp;   */}

        <Nav.Item className="dropdown">
        {/* <li className="nav-item dropdown"> */}
        <Nav.Link to="/cute'sdevelopment" className="nav-link dropdown-toggle nav-link active" id="navbarDropdown" role="button" data-bs-toggle="dropdown" aria-expanded="false">
          <FontAwesomeIcon icon = {faBaby}/> &nbsp;
            Cute's Development
          </Nav.Link>
          </Nav.Item> 
          <ul className="dropdown-menu bg-dark" aria-labelledby="navbarDropdown">
            <li><a className="dropdown-item text-white" href="/pregnancybyweek">Pregnancy by week</a></li>
            <li><a className="dropdown-item text-white" href="/inthewomb">In the womb</a></li>
            <li><hr className="dropdown-divider text-white"/></li>
            <li><a className="dropdown-item text-white" href="/kickcounter">Kick Counter</a></li>
            <li><a className="dropdown-item text-white" href="/contractiontimer">Contraction Timer</a></li>
            <li><a className="dropdown-item text-white" href="/growthtracker">Growth Tracker</a></li>
          </ul>
        {/* </li> &nbsp;   &nbsp;   &nbsp;   */}

        <li className="nav-item dropdown">
        <Link to="/planning" className="nav-link dropdown-toggle nav-link active" id="navbarDropdown" role="button" data-bs-toggle="dropdown" aria-expanded="false">
          <FontAwesomeIcon icon = {faCheckCircle}/>&nbsp;  
            Planning
          </Link>
          <ul className="dropdown-menu bg-dark" aria-labelledby="navbarDropdown">
            <li><a className="dropdown-item text-white" href="/hospitalbagchecklist">Hospital bag checklist</a></li>
            <li><a className="dropdown-item text-white" href="/mybabyname">My baby name</a></li>
          </ul>
        </li> &nbsp;&nbsp;&nbsp;

        <li className="nav-item dropdown">
        <Link to="/education&support" className="nav-link dropdown-toggle nav-link active" id="navbarDropdown" role="button" data-bs-toggle="dropdown" aria-expanded="false">
          <FontAwesomeIcon icon = {faFileAlt}/>&nbsp; 
            Education & Support
          </Link>
          <ul className="dropdown-menu bg-dark" aria-labelledby="navbarDropdown">
            <li><a className="dropdown-item text-white" href="/dailyselfcarechecklist">Daily self-care checklist</a></li>
            <li><a className="dropdown-item text-white" href="/articles&videos">Articles & Videos</a></li>
            <li><a className="dropdown-item text-white" href="/insights">Insights</a></li>
          </ul>
        </li>&nbsp;&nbsp;&nbsp; 

        <li className="nav-item dropdown">
        <Link to="/product&safety" className="nav-link dropdown-toggle nav-link active" id="navbarDropdown" role="button" data-bs-toggle="dropdown" aria-expanded="false">
          <FontAwesomeIcon icon = {faAd}/>&nbsp;
            Product & Safety
          </Link>
          <ul className="dropdown-menu bg-dark" aria-labelledby="navbarDropdown">
            <li><a className="dropdown-item text-white" href="/babyproducts">Baby products</a></li>
            <li><a className="dropdown-item text-white" href="/doctorchanneling">Doctor channeling</a></li>
          </ul>
        </li>&nbsp;&nbsp;&nbsp; 

        <li className="nav-item">
        <Link to="/calendar" className="nav-link active">
          <FontAwesomeIcon icon = {faCalendarAlt}/>&nbsp;
              Calendar
        </Link>
        </li> &nbsp;&nbsp;&nbsp; 

        <li className="nav-item">
        <Link to="/health&medical" className="nav-link active">
          <FontAwesomeIcon icon = {faUserMd}/>&nbsp;
              Health & Medical
        </Link>
        </li> &nbsp;&nbsp;&nbsp; 
        {/* </Nav> */}
        <Link to="/signup" class="btn btn-success">Sign Up</Link>

      {/* </ul> */}

      <form className="d-flex">
        <input className="form-control me-2" type="search" placeholder="Search" aria-label="Search" />
        <button className="btn btn-outline-success" type="submit">Search</button>
      </form>
    </div>
  </div>
</nav>
    )
}

export default Navbar;
